import React from 'react';
import { saveOrganizationDetails } from "../../store/actions/newAuction";
import { connect } from "react-redux";
const OrganizationInformation = () => {
    let name = "";
    let photos = [];
    return (
        <form>
            <label> The organization name</label>
            <input type="text" onChange={(e) => name = e.target.value} />
            <label>Upload photos of the organization</label>
            {/* לשמור תמונות שהוא מעלה */}
            <input type="button" value="upload photos" onChange={(e) => photos.push()} />
            <input type="submit" value="Ok" onClick={() => { saveOrganizationDetails(name, photos) }} />
        </form>);
    //לבדוק שהתאריכים תקינים
    //סיום ההרשמה ולפני ביצוע ההגרלות
    //למה התאריכים לא נשמרים בסטייט
}

export default connect(null, { saveAuctionDetails })(OrganizationInformation);
